/* Function  structure for function  `newOrderNo` */

/*!50003 DROP FUNCTION IF EXISTS `newOrderNo` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `newOrderNo`(

	orderNamePre VARCHAR(2),

	num INT) RETURNS varchar(25) CHARSET utf8
BEGIN

	DECLARE newOrderNo VARCHAR (25);

	DECLARE currentDate VARCHAR (15);

	DECLARE maxNo INT DEFAULT 0 ;

	

	IF num = 8 THEN -- æ ¹æ®å¹´æœˆæ—¥ç”Ÿæˆè®¢å•ç¼–å·     

	    SELECT DATE_FORMAT(NOW(), '%Y%m%d') INTO currentDate ;

	ELSEIF num = 14 THEN -- æ ¹æ®å¹´æœˆæ—¥æ—¶åˆ†ç§’ç”Ÿæˆè®¢å•ç¼–å·     

	    SELECT DATE_FORMAT(NOW(), '%Y%m%d%H%i%s') INTO currentDate ;

	ELSE -- æ ¹æ®å¹´æœˆæ—¥æ—¶åˆ†ç”Ÿæˆè®¢å•ç¼–å·     

	    SELECT DATE_FORMAT(NOW(), '%Y%m%d%H%i') INTO currentDate ;

	END IF ; 

	

	SELECT COUNT(*) FROM wa_order WHERE INSTR(order_no,currentDate) INTO maxNo;

	

	SELECT CONCAT(orderNamePre, currentDate,  LPAD((maxNo + 1), 5, '0')) INTO newOrderNo ;

	

	RETURN newOrderNo ;

    END */$$
DELIMITER ;

